'use strict'

const express = require('express');
const authenticationController = require('./authenticationController');
const md_auth = require('./../common/middlewares/authenticated')
const router = express.Router();

router.post("/accounts/sessions", authenticationController.userAuthentication);
router.post("/accounts/sessions/me/refresh", md_auth.authenticated, authenticationController.refreshToken);
router.post("/accounts/logout", md_auth.authenticated, authenticationController.logOut);


module.exports = router;

