"use strict";

const operations = require("./authenticationOperations");
const responseManagement = require("./../common/responseManagement");
const encrypt = require("./../common/encrypt");
const jwtFuncs = require("./../common/jwtFuncs");
const loggerManagement = require("../common/logger");


exports.userAuthentication = async (request, response) => {
  try {
    const user = { userName: request.body.userName || "", password: request.body.password || "" };
    const pass = encrypt.generateHashPassword(user.password);
    console.log('pas:', pass);

    const res = await operations.userAuthentication(user)

    //usuario encontrado en la base de datos
    if (res.code == 200) {
      //verifica si la contraseña es correcta
      if (encrypt.comparePasswordHash(user.password, res.data.password)) {
        const message = {
          message: 200,
          token: jwtFuncs.signAuth({
            uuid: res.data.uuid,
            user: res.data.user,
            profile: res.data.profile,
          })
        };

        return responseManagement.SUCCESS(response, message)
      }

      //Contraseña invalida
      return responseManagement.UNAUTHORIZED(response, {
        message: "Unauthorized. The provided user name and password are invalid."
      });
    }
  } catch (error) {
    loggerManagement.insertLog(new Date().getTime(), request.method, 'CONTROLLER', request.path, err);
    return responseManagement.SERVER_ERROR(response, JSON.parse(JSON.stringify(err, Object.getOwnPropertyNames(err))));
  }
};


exports.refreshToken = (request, response) => {
  const tokenData = {
    id: request.tokenData.id
  };
  const message = {
    message: 'The session was successfully refresh. A new session token is retrieved.',
    token: jwtFuncs.signAuth(tokenData)
  };
  return responseManagement.customResponse(response, new Date().getTime(), request.method, 3, request.path, message, "Rs", '200')
};






exports.logOut = (request, response) => {
  const dataLogOut = {
    id: request.tokenData.id
  }
  const dataSession = {
    id_cuenta: request.tokenData.id,
    tipo: 32
  }

  operations.logout(dataLogOut).then(result => {
    if (result.status_code == "200") {
      const message = {
        message: result.status_desc
      };

      operations.saveSession(dataSession)
      return responseManagement.customResponse(response, new Date().getTime(), request.method, 4, request.path, message, "Rs", result.status_code)
    }
    return responseManagement.serverErrorResponse(response, new Date().getTime(), request.method, 4, request.path, result, "Rs")
  })
    .catch(err => {
      return responseManagement.serverErrorResponse(response, new Date().getTime(), request.method, 4, request.path, JSON.parse(JSON.stringify(err, Object.getOwnPropertyNames(err))), "Rs")
    });
}

