const service = require("./authenticationService");
const codes = require("../common/codesResponse");
const loggerManagement = require("../common/logger");

let operations = {};


operations.userAuthentication = async (user) => {
  try {
    const data = await service.filterUser(user);

    if (data.code != codes.SUCCESS) {
      if (data.user != user.userName || data.password != user.password) {
        data.code = codes.UNAUTHORIZED;
        return data;
      }

      return data;
    }

    return data;
  } catch (error) {
    loggerManagement.insertLog(new Date().getTime(), '', 'OPERATIONS', '', err);
    return err;
  }
};


// operations.logout = (logout) => {
//   return database.getConnection().then(connection => {
//     return database.executeQuery(connection, sql, parameters, true).then(result => {

//       database.closeConnection(connection);
//       return result.outBinds;
//     });
//   });
// };


module.exports = operations;

