sourcesContent:
const database = require("../common/database");
const codes = require("../common/codesResponse");
const loggerManagement = require("../common/logger");

let services = {};


services.filterUser = async (user) => {
  try {
    const res = await database.getUsers();

    let response = { code: codes.DATA_NOT_FOUND, data: {} };

    const USER_FILTER = res.map(el => {
      if (el.user == user.userName) {
        return { code: codes.SUCCESS, data: el };
      }
    });

    if (USER_FILTER[0].code == codes.SUCCESS) response = { code: codes.SUCCESS, data: USER_FILTER[0].data };

    return response;
  } catch (error) {
    loggerManagement.insertLog(new Date().getTime(), '', 'SERVICE', '', err);
    return err;
  }
};


module.exports = services;

