'use strict'
const responses = {}

//RESPUESTA EXITOSA
responses.SUCCESS = (response, message) => {
    return response.status(200).send(message);
}

//ERROR DE AUTENTICACION NO ABIERTA
responses.TECHNICAL_ERROR = (response, message) => {
    return response.status(400).send(message);
}

//RESPUESTA SIN PROCESAR
responses.UNPROCESSABLE_ENTITY = (response, message) => {
    return response.status(422).send(message);
}

//RESPUESTA SIN PROCESAR
responses.NOT_FOUND = (response, message) => {
    return response.status(404).send(message);
}

//DATOS NO ENCONTRADOS
responses.DATA_NOT_FOUND = (response, message) => {
    return response.status(204).send(message);
}

//ERROR CUANDO EL ESTADO DEL USUARIO NO PERMITE INICIO DE SESIÓN
responses.UNAUTHORIZED = (response, message) => {
    return response.status(401).send({
        "message": message.message
    });
}

//ERROR EN LOS SERVIDORES
responses.SERVER_ERROR = (response, messageResponse = "Internal server error") => {
    return response.status(500).send({
        "message": messageResponse
    });
}




module.exports = responses

