'use strict'

const responseManagement = require('./../responseManagement')
const jwtFuncs = require('./../jwtFuncs');


exports.authenticated = (request, response, next) => {
  let token = request.headers.authorization;

  if (token) {
    token = token.replace('Bearer ', '');
  }

  const decoded = jwtFuncs.verifyAuth(token);

  if (decoded.status == 1) {
    request.tokenData = decoded.data;
    next()
  } else {
    const message = {
      message: "Not authorized. The provided token is not valid."
    };

    return responseManagement.UNAUTHORIZED(response, message);
  }
};
